-- ----------------------------
-- Table structure for pf_area
-- ----------------------------
DROP TABLE IF EXISTS `pf_area`;
CREATE TABLE `pf_area` (
  `area_id` int(6) NOT NULL AUTO_INCREMENT COMMENT '区/县序号',
  `province_id` int(6) DEFAULT NULL COMMENT '外键    所属省份',
  `city_id` int(6) DEFAULT NULL COMMENT '外键     所属市',
  `area_name` varchar(50) NOT NULL COMMENT '区/县名称',
  `update_user` varchar(100) NOT NULL COMMENT '修改人',
  `update_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `created_user` varchar(100) DEFAULT NULL COMMENT '创建人',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`area_id`)
) ENGINE=InnoDB AUTO_INCREMENT=659007 DEFAULT CHARSET=utf8 COMMENT='区/县';

